// Assuming the generated proxy class is MyService\n\nvar client = new MyService.ServiceClient();\n\nvar keyValueArray = new List<MyService.keyValue>\n{\n    new MyService.keyValue { key = "company_data", value = "Test company name" },\n    new MyService.keyValue { key = "slogan", value = "Test company slogan" },\n};\n\nvar map = new MyService.map { item = keyValueArray.ToArray() };\n\nvar request = new MyService.registerAccountRequest\n{\n    key = "your_key_value",\n    data = map\n};\n\nvar response = client.registerAccount(request);\n\nConsole.WriteLine(response.success);